import React from "react";
import {Text,View,TextInput,StyleSheet} from "react-native";

export default function Calculate ()
{
    return(
        /* 5 окошек */
        <View>
    <View style = {styles.poles}>
        <Text> Q = </Text>
        <TextInput placeholder = 'Вводить Q'/>
    </View>
    <View style = {styles.poles}>
    <Text> m = </Text>
    <TextInput placeholder = 'Вводить m'/>
    </View>
    <View style = {styles.poles}>
    <Text> c = </Text>
    <TextInput placeholder = 'Вводить c'/>
    </View>
    <View>
        <Text>T кипения </Text>
        <Text>T </Text>
    </View>
    <View style = {styles.poles}>
    <Text> T2 = </Text>
    <TextInput placeholder = 'Вводить T2'/>
    </View>
    <View style = {styles.poles}>
    <Text> T1 = </Text>
    <TextInput placeholder = 'Вводить T1'/>
    </View>
</View>  
    )  
};
 const styles = StyleSheet.create(
     {
        poles:
        {
            color:'black',
            flexDirection:'row',
        },
     }
 )
